CREATE DEFINER=`root`@`localhost` PROCEDURE `roll_semester`(in start_date date, in end_date date)
BEGIN
	declare done int default false;
    declare lab_id int;
    declare day_cnt, lab_cnt int;
    declare day_index, lab_index int;
    declare weekday int;
    declare date_temp date;
    declare slot1_type, slot1_status, slot2_type, slot2_status, slot3_type, slot3_status, slot4_type, slot4_status, slot5_type, slot5_status, slot6_type, slot6_status int;
    
    declare lab_cur cursor for select id from lab where isActive = true;
    
    -- declare continue handler for not found set done = true;
    set lab_cnt = (select count(*) from lab where isActive = true);
    open lab_cur;
    set lab_index = 0;
    while lab_index < lab_cnt do
		set lab_index = lab_index+1;
		fetch lab_cur into lab_id;

        set day_index = 0;
        set day_cnt = datediff(end_date, start_date) + 1;
        while day_index < day_cnt do
			set date_temp = DATE_ADD(start_date,INTERVAL day_index DAY);
			set weekday = dayofweek(date_temp) - 1;
            select t.slot1Type, t.slot1Status, t.slot2Type, t.slot2Status, t.slot3Type, t.slot3Status, t.slot4Type, t.slot4Status, t.slot5Type, t.slot5Status, t.slot6Type, t.slot6Status  
            into slot1_type, slot1_status, slot2_type, slot2_status, slot3_type, slot3_status, slot4_type, slot4_status, slot5_type, slot5_status, slot6_type, slot6_status 
			from weekly_plan_template t where t.weekday = weekday ; 
            insert into lab_plan 
            (create_time, modify_time, `date`, `weekday`, labId, slot1Type, slot1OpenStatus, slot2Type, slot2OpenStatus, slot3Type, slot3OpenStatus, slot4Type, slot4OpenStatus, slot5Type, slot5OpenStatus, slot6Type, slot6OpenStatus) 
            values (current_timestamp(),current_timestamp(), date_temp, weekday, lab_id, slot1_type, slot1_status, slot2_type, slot2_status, slot3_type, slot3_status, slot4_type, slot4_status, slot5_type, slot5_status, slot6_type, slot6_status);
            set day_index = day_index + 1;
        end while;
    end while;

END ;;
DELIMITER ;
